import React from "react";
import {about} from './About.module.css';

function About() {
  return (
    <div className={about}>
      <p>
        Hola. Mi nombre es Julián Alvarez Windey, y esta es mi Henry-weather app. Se
        trata de una aplicación que, como bien su nombre lo indica, te permite acceder
        a información meteorológica de distintos lugares del mundo.
      </p>
      <p>
        Para conocer cómo está el tiempo en alguna ciudad, simplemente busca su
        nombre en el navegador que tenés arriba a la derecha. No hace falta que la
        primer letra que escribas sea mayúscula, ¡pero ojo!, asegurate de que el
        nombre esté bien escrito.
      </p>
      <p>
      </p>
    </div>
  )
}

export default About;
